import axios from 'axios';
import React, { Component } from 'react';
import { Button, Col, Container, Form, Row } from 'react-bootstrap';

class Register extends Component {
    constructor() {
        super();
        this.state = {
            f_name: '',
            l_name: '',
            username: '',
            password: '',
            password1: '',
            email: '',
            message: '',
            flag: null,
        };
    }

    changeHandler = (ev) => {
        let nam = ev.target.name;
        let val = ev.target.value;
        this.setState({
            [nam]: val
        });
    }

    submit = (e) => {
        e.preventDefault();
        if (this.state.password === this.state.password1) {
            if (this.state.email && this.state.username) {
                axios.post('http://localhost:3001/register', this.state)
                    .then((response) => {
                        if (response.data.message) {
                            this.setState({
                                message: response.data.message,
                                flag: 1
                            });
                        } else {
                            this.setState({
                                message: response.data.warning,
                                flag: 2
                            });
                        }
                    })
                    .catch((error) => {
                        console.error("There was an error!", error);
                        this.setState({
                            message: 'An error occurred while registering. Please try again later.',
                            flag: 1
                        });
                    });
            } else {
                alert("Please fill all form");
            }
        } else {
            alert("Entered Passwords do not match. Please try again.");
        }
    }

    render() {
        let message;
        if (this.state.flag === 1) {
            message = <div className="alert alert-danger alert-dismissible fade show" role="alert">
                <strong>{this.state.message}</strong><br />
            </div>
        } else if (this.state.flag === 2) {
            message = <div className="alert alert-danger alert-dismissible fade show" role="alert">
                <strong>{this.state.message}</strong><br />
                Forget Your password?<a href='#'>Click Here</a>
            </div>
        }

        return (
            <Container className="my-5">
                <Row className="justify-content-center">
                    <Col md={6} lg={10} className="border p-4 rounded shadow-sm">
                        {message}
                        <Form>
                            <Form.Group className="mb-3">
                                <Form.Label>First Name</Form.Label>
                                <Form.Control name='f_name' type="text" placeholder="First Name" onChange={this.changeHandler} required />
                            </Form.Group>

                            <Form.Group className="mb-3">
                                <Form.Label>Last Name</Form.Label>
                                <Form.Control name='l_name' type="text" placeholder="Last Name" onChange={this.changeHandler} required />
                            </Form.Group>

                            <Form.Group className="mb-3">
                                <Form.Label>User Name</Form.Label>
                                <Form.Control name='username' type="text" placeholder="User Name" onChange={this.changeHandler} required />
                            </Form.Group>

                            <Form.Group className="mb-3">
                                <Form.Label>Email address</Form.Label>
                                <Form.Control name='email' type="email" placeholder="Enter Email" onChange={this.changeHandler} required />
                                <Form.Text className="text-muted">
                                    We'll never share your email with anyone else.
                                </Form.Text>
                            </Form.Group>

                            <Form.Group className="mb-3">
                                <Form.Label>Password</Form.Label>
                                <Form.Control name='password' type="password" placeholder="Password" onChange={this.changeHandler} required />
                            </Form.Group>

                            <Form.Group className="mb-3">
                                <Form.Label>Confirm Password</Form.Label>
                                <Form.Control name='password1' type="password" onChange={this.changeHandler} placeholder="Confirm Password" />
                            </Form.Group>

                            <Button onClick={this.submit} variant="primary" type="submit">
                                Submit
                            </Button>
                        </Form>
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default Register;
